- input: "TEXT\x1CC00462143\x1C1\x1C\x1CF3A\x1CThis amendment is in response to the
    Request for Additional Information from the Commission.  First, the contributions
    that appear to exceed the limits set forth in the Act have been refunded and reattributed
    and this will show on the January 31st Year End Report.  Second, the contributions
    that were designated to the General 2010 election were designated as such in error
    and those designations have been corrected on this amendment.  Third, the contribution
    from an organization which is not a political committee registered with the Commission
    has been verified as permissible funds.  In this amendment we have edited the
    record for the contribution and added a notation that the funds are permissible.
    \ Fourth, our committee does have in place a system that meets the best efforts
    standard established by the Commission.  All of our original solicitations have
    the request for employer and occupation information on them.  We inform the potential
    donor that we are required by federal law to request this information.  For the
    donors that do not provide that information, we automatically send them a written
    request for it within 30 days.  This follow up does not request any additional
    monies and contains a self addressed envelope and again informs the person of
    the federal requirement for requesting this information.  Finally, we add the
    new information to our database and include it in amended reports filed with the
    commission and subsequent reports going forward.  All line 12 memos that meet
    the itemization threshold limit are itemized appropriately.\n"
